import React from 'react';
import Icon from './Icon';
import * as icons from '../Icons';
import Grid from '../Grid/Grid';
export default {
  title: 'Grid System',
  component: Grid,
  parameters: {
    // Optional parameter to center the component in the Canvas. More info: https://storybook.js.org/docs/react/configure/story-layout
    layout: 'centered'
  },
  // This component will have an automatically generated Autodocs entry: https://storybook.js.org/docs/react/writing-docs/autodocs
  tags: ['autodocs'],
  // More on argTypes: https://storybook.js.org/docs/react/api/argtypes
  argTypes: {}
};
export const IconComponent = () => <>
    <Grid container justifyContent={'center'} alignItems={'center'} spacing={2}>
      {Object.keys(icons).map(key => {
      return <>
            <Grid item={1}>
              <span style={{
            fontSize: '10px',
            color: '#fff'
          }}>{key}</span>
              <Icon>{React.createElement(icons[key])}</Icon>
            </Grid>
          </>;
    })}
    </Grid>
  </>;
IconComponent.parameters = {
  ...IconComponent.parameters,
  docs: {
    ...IconComponent.parameters?.docs,
    source: {
      originalSource: "() => <>\n    <Grid container justifyContent={'center'} alignItems={'center'} spacing={2}>\n      {Object.keys(icons).map(key => {\n      return <>\n            <Grid item={1}>\n              <span style={{\n            fontSize: '10px',\n            color: '#fff'\n          }}>{key}</span>\n              <Icon>{React.createElement(icons[key])}</Icon>\n            </Grid>\n          </>;\n    })}\n    </Grid>\n  </>",
      ...IconComponent.parameters?.docs?.source
    }
  }
};
